import React from 'react';
import css from './Login.module.css';
import { Field, reduxForm } from 'redux-form';

const LoginForm = () => {
    return (
            <form>
                <div className={css.wrapper}>
                    <Field required className={css.field} placeholder={"login"} component="input"/>
                    <Field className={css.field} placeholder={"password"} component="input"/>
                    <div className={css.checkboxWrap}>

                        <Field id="check" type="checkbox" component={"input"}/>
                        <label htmlFor="check">Remember me</label>
                        <button type="submit">Login</button>

                    </div>
                </div>
            </form>

    )
}

const Login = (props) => {
    return (
        <div className={css.login}>
            <h1>Login</h1>
            <LoginReduxForm />
        </div>
    )
}



const LoginReduxForm = reduxForm({form:'loginForm'})(LoginForm)


export default Login;
